        private readonly GithubClientCache _cache = new GithubClientCache();
        //private readonly GitHubClient _githubClient;
        private readonly IConfiguration _configuration;

        public GithubClientService(IConfiguration configuration)
        {
            _configuration = configuration;
            //_githubClient = new GitHubClient(new ProductHeaderValue(_configuration.GetSection("GithubOAuth:AppHeader").Value));
        }

        public GitHubClient GetGitHubClient(ObjectId id)
        {
            var result = _cache.GetClient(id);
            if (result == null)
            {
                result = new GitHubClient(new Octokit.ProductHeaderValue(_configuration.GetSection("GithubOAuth:AppHeader").Value));
                _cache.Add(id, result);
            }
            return result;
        }

        public async Task<List<Issue>> GetMyOpenIssues(ObjectId id)
        {
            var githubClient = GetGitHubClient(id);

            List<Issue> issues = new List<Issue>();
            var request = new SearchIssuesRequest();
            request.State = ItemState.Open;
            var result = await githubClient.Search.SearchIssues(request);

            issues = result.Items.ToList();
            return issues;
        }

        public async Task<IReadOnlyList<Issue>> GetIssues(ObjectId id, string username, string repo)
        {
            var githubClient = GetGitHubClient(id);
            var issues = await githubClient.Issue.GetAllForRepository(username, repo);
            return issues;
        }

        public async Task<List<Repository>> GetMyRepositories(ObjectId id)
        {
            var githubClient = GetGitHubClient(id);

            var repos = await githubClient.Repository.GetAllForCurrent();
            return repos.ToList();
        }

        public async Task<Repository> GetRepository(ObjectId id, string name, string owner)
        {
            var githubClient = GetGitHubClient(id);

            return await githubClient.Repository.Get(owner, name);
        }

        public async Task<List<Branch>> GetBranches(ObjectId id, Repository repo)
        {
            var githubClient = GetGitHubClient(id);

            return (await githubClient.Repository.Branch.GetAll(repo.Id)).ToList();
        }

        public async Task<JArray> GetRepoEvents(string owner, string repoName, string token)
        {
            string url = $"https://api.github.com/repos/{owner}/{repoName}/events?per_page=70";

            HttpClient client = new HttpClient();
            client.DefaultRequestHeaders.Add("User-Agent", _configuration.GetSection("GithubOAuth:AppHeader").Value);
            client.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Bearer", token);

            var response = await client.GetStringAsync(url);
            var eventJsonArray = JsonConvert.DeserializeObject<JArray>(response);
            return eventJsonArray;
        }

